import React from 'react';
import '../Profile/Profile.css';

const UserComponent = (props) => {
    return (
        <div>
            <img src={props.avatarSrc} className={'avatar'}/>

        <div>
            {props.firstName} {props.secondName}
        </div>
        </div>
    );
}

export default UserComponent;
